export const Nav = () => {
  return (
    <div className="container">
        <div className="row">
            <nav>
                <Link to="/">
                    <img src="https://upload.wikimedia.org/wikipedia/commons/thumb/3/3c/IMG_logo_%282017%29.svg/1200px-IMG_logo_%282017%29.svg.png"  alt="logo" />
                </Link>
            </nav>
        </div>
    </div>
  );
};
